import React from 'react';
import '../css/App.css';
import 'bootstrap/dist/css/bootstrap.css';


const App = () => {
  return (
    <>
      <div className='d-flex flex-row'>
        <h1 className='text-break'> oke</h1>
        <h2 className='h2'>oke2</h2>
      </div>
      <div className="App">
        <header className="App-header">
          <img src="/logo.svg" className="App-logo" alt="logo" />
          <p>
            tôi cảm thấy code của cái này cần phải sửa
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    </>

  )
}

export default App;
